import React from "react";
import "./SideBar.css";
import SideBarHeader from "./SideBarHeader";

const SideBar = () => {
  return (
    <div className="sidebar">
      <div className="sidebar__header">
        <SideBarHeader></SideBarHeader>
      </div>
    </div>
  );
};

export default SideBar;
